import './App.css';
import Calendar from './Components/temp'
import Home from './Components/Home'

import { Navbar, Nav } from 'rsuite';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar className='navbar' appearance='default'>
          <Navbar.Brand><Link to="/home">LOGO</Link></Navbar.Brand>
          <Nav>
            <Nav.Item><Link>Kezdőlap</Link></Nav.Item>
            <Nav.Item><Link>Rólam</Link></Nav.Item>
            <Nav.Item><Link to="/calendar">Időpontfoglalás</Link></Nav.Item>
          </Nav>
          <Nav pullRight>
            <Nav.Item><Link>Időpontfoglalás</Link></Nav.Item>
          </Nav>
      </Navbar>
          <Routes>
            <Route exact path="/" element={<Home/>} />
            <Route exact path="/home" element={<Home/>} />
            <Route path="/calendar" element={<Calendar/>} />
          </Routes>
      </div>
    </Router>


  );
}


export default App;
